import React from 'react';
import './nav.css';
import rock1 from '../assest/Group 3.png';
import rock2 from '../assest/Group 4.png';

function Head() {
  return (
  <div className='hd'>
     <div className='imges'>
         <img alt='1' src={rock1}/>
         <img alt='2' src={rock2}/>
     </div>
   </div>
  )
}

export default Head ;
